import photo from './img/photo.png'

//same stuff as in specialtyAside.js
export default function DisplayDoctors({data: {specjalizacje}}) {
  console.log(specjalizacje)
  return (
    <div className='w-full flex p-2'>
      <div id='docPhoto' className='w-20 rounded-full'>
        <img src={photo} className='ml-10 rounded-full w-full h-20'/>
      </div>

      <div id='docInfo' className='w-full ml-2 '>
        Anna Szyszka

      </div>

    </div>
  )
}
